pragma solidity ^0.4.18;
import "./SafeMath.sol";
import "./Pausable.sol";

interface CaptainTokenInterface {
function getCaptainInfo(uint256 _tokenId) external view returns (
    uint32 captainId,  
    uint32 color, 
    uint32 atk_min,
    uint32 atk_max,
    uint32 defense,
    uint32 level,
    uint256 exp, 
    uint256 price,
    address owner
  );
  function ownerOf(uint256 _tokenId) external view returns (address);
  function transferFrom(address _from, address _to, uint256 _tokenId) external;
  function setTokenPrice(uint256 _tokenId, uint256 _price) external;
  function CreateCaptainToken(address _owner,uint256 _price, uint32 _captainId, uint32 _color,uint32 _atk_min, uint32 _atk_max,uint32 _defense,uint32 _level,uint256 _exp) public;
  function safeTransferByContract(address _from,address _to, uint256 _tokenId) external;
  function setSelled(uint256 _tokenId, bool fsell) external;
  function getprice(uint256 _curPrice,uint32 _level) external returns(uint256);
  function getSelled(uint256 _tokenId) external view returns (bool);
}


contract CaptainMarket is Pausable {
  using SafeMath for SafeMath;
  address devAddress;
  event deubug(address v1);
     // Represents an auction on an NFT
  struct Auction {
    // Current owner of NFT  
    address seller;
    // Price (in wei) at beginning of auction  
    uint128 startPrice;
    // Duration (in seconds) of auction
    uint64 duration;
    // Time when auction started  
    // NOTE: 0 if this auction has been concluded
    uint64 startedAt;
  }

  function CaptainMarket() public {
    devAddress = msg.sender;
  }
  CaptainTokenInterface public captains;
  /// @dev The BuyToken event is fired whenever a token is sold.
  event BuyToken(uint256 tokenId, uint256 oldPrice, address prevOwner, address winner);

  // Map from token ID to their corresponding auction. 
  mapping (uint256 => Auction) tokenIdToAuction;

  event AuctionCreated(uint256 tokenId, uint256 startPrice, uint256 duration);
  event AuctionSuccessful(uint256 tokenId, uint256 totalPrice, address winner);
  event AuctionCancelled(uint256 tokenId);

  uint256 onAuction;

  function() external payable {
  }

  modifier onlyOwner {
    require(msg.sender == devAddress); 
    _;
  }

  //setting configuration
  function setCaptainTokenContract(address _address) external onlyOwner {
    captains = CaptainTokenInterface(_address);
  }

    /// @dev Creates and begins a new auction.
    /// @param _tokenId - ID of token to auction, sender must be owner.
    /// @param _startPrice - Price of item (in wei) at beginning of auction.
    /// @param _duration - Length of time to move between starting
    ///  price and ending price (in seconds).
  function createAuction(
    uint256 _tokenId,
    uint256 _startPrice,
    uint64 _duration
  )
  external
  whenNotPaused
  {
    // Sanity check that no inputs overflow how many bits we've allocated
    // to store them in the auction struct.
    require(_startPrice == uint256(uint128(_startPrice)));
    require(_duration == uint256(uint64(_duration)));
    require(captains.ownerOf(_tokenId) == msg.sender);

    Auction memory auction = Auction(
      msg.sender,
      uint128(_startPrice),
      uint64(_duration),
      uint64(now)
    );
    _addAuction(_tokenId, auction);
    //captains.setSelled(_tokenId,true);
  }



    /// @dev Return all the auction tokens
  function getAuctions() external view returns (uint256[]) {
    uint256[] memory result = new uint256[](onAuction);
    uint256 tokenId = 1;
    for (uint i=1;i<=onAuction;i++) {
      if ( captains.getSelled(i) == true) {
        result[i] = tokenId;
        tokenId ++;
      }
    }
    return result;
  }

  /// @param _tokenId - ID of NFT on auction.
  function getAuction(uint256 _tokenId)
    external
    view
    returns
    (
        address seller,
        uint256 startPrice,
        uint256 duration,
        uint256 startedAt
    ) {
    Auction storage auction = tokenIdToAuction[_tokenId];
    if (_isOnAuction(auction)) {
      return (
      auction.seller,
      auction.startPrice,
      auction.duration,
      auction.startedAt
      );
    } else {
      return (address(0),0,0,0);
    }
  }
    /// @dev Adds an auction to the list of open auctions. Also fires the
    ///  AuctionCreated event.
    /// @param _tokenId The ID of the token to be put on auction.
    /// @param _auction Auction to add.
  function _addAuction(uint256 _tokenId, Auction _auction) internal {
    // Require that all auctions have a duration of
    // at least one minute. (Keeps our math from getting hairy!)
    require(_auction.duration >= 1 minutes);

    tokenIdToAuction[_tokenId] = _auction;
    //event
    AuctionCreated(
      uint256(_tokenId),
      uint256(_auction.startPrice),
      uint256(_auction.duration)
    );
  }

  /// @dev Returns true if the NFT is on auction.
  /// @param _auction - Auction to check.
  function _isOnAuction(Auction storage _auction) internal view returns (bool) {
    return (_auction.startedAt > 0);
  }


  // Allows someone to send ether and obtain the token
  function purchase(uint256 _tokenId) external payable {
    Auction storage auction = tokenIdToAuction[_tokenId];
    address seller = auction.seller;
    uint256 startPrice = auction.startPrice;

    // Making sure token owner is not sending to self
    require(seller != msg.sender);

    // Safety check to prevent against an unexpected 0x0 default.
    require(msg.sender != address(0));

    // Making sure sent amount is greater than or equal to the sellingPrice
    require(msg.value >= startPrice);

    uint256 payment = uint256(SafeMath.div(SafeMath.mul(startPrice, 93), 100));
    uint256 purchaseExcess = SafeMath.sub(msg.value, startPrice); 
    uint256 commission = SafeMath.sub(startPrice,payment); 
    uint256 nextPrice = SafeMath.div(SafeMath.mul(startPrice, 125), 100);

    //update prices
    //IndexToPrice[_tokenId] = nextPrice;
    captains.setTokenPrice(_tokenId,nextPrice);
    //_transfer(oldOwner, msg.sender, _tokenId);
    captains.safeTransferByContract(seller,msg.sender, _tokenId);
		// Pay previous tokenOwner if owner is not contract
    if (seller != address(this)) {
      seller.transfer(payment); //(1-0.07)
    }

    msg.sender.transfer(purchaseExcess);
    devAddress.transfer(commission);
    //delete token from auction
    delete tokenIdToAuction[_tokenId];
    captains.setSelled(_tokenId,true);
    //event 
    BuyToken(_tokenId, startPrice,seller,msg.sender);
  }

   // Allows someone to send ether and obtain the token
  function buy(uint256 _tokenId) external payable {
    uint32 level;
    address curOwner;
    uint256 curPrice;
    (,,level,,curPrice,curOwner) = captains.getCaptainInfo(_tokenId);
    // Making sure token owner is not sending to self
    require(curOwner != msg.sender);

    // Safety check to prevent against an unexpected 0x0 default.
    require(msg.sender != address(0));

    // Making sure sent amount is greater than or equal to the sellingPrice
    require(msg.value >= curPrice);

    uint256 payment = uint256(SafeMath.div(SafeMath.mul(curPrice, 93), 100));
    uint256 purchaseExcess = SafeMath.sub(msg.value, curPrice); 
    uint256 commission = SafeMath.sub(curPrice,payment);
    uint256 nextPrice = captains.getprice(curPrice,level);

    //update prices
    //IndexToPrice[_tokenId] = nextPrice;
    captains.setTokenPrice(_tokenId,nextPrice);
    //_transfer(oldOwner, msg.sender, _tokenId);
    captains.transferFrom(curOwner,msg.sender, _tokenId);
		// Pay previous tokenOwner if owner is not contract
    if (curOwner != address(this)) {
      curOwner.transfer(payment); //(1-0.07)
    }

    msg.sender.transfer(purchaseExcess);
    devAddress.transfer(commission);
    //event 
    BuyToken(_tokenId, curPrice,curOwner,msg.sender);
  }

}
